import React from 'react';
import logo from './logo.svg';
import './Nav.css';

const menus = [
  {menu_id: 1, menu_title: 'Lorem'},
  {menu_id: 2, menu_title: 'Ipsum'},
  {menu_id: 3, menu_title: 'Dolor'},
  {menu_id: 4, menu_title: 'Sit Amet'}
]

function NavLeft(props) {
  const menu = props.menus.map((menu) =>
    <a key={menu.menu_id}
      className="Nav-item">
      {menu.menu_title}
    </a>
  );

  return (
    <div className="Nav-left">
    </div>
  );
}

function NavRight() {
  return (
    <div className="Nav-right">
    </div>
  );
}

function Nav() {
  return (
    <nav className="Nav">
      <NavLeft menus={menus} />
      <NavRight />
    </nav>
  );
}

export default Nav;
